--
-- Name: user_financial_summary; Type: VIEW; Schema: public; Owner: expenses
--

CREATE VIEW public.user_financial_summary AS
 WITH userexpenses AS (
         SELECT t.user_id,
            t.amount,
            t.transaction_date,
            c.id AS category_id,
            c.name AS category_name
           FROM (public.api_transaction t
             JOIN public.api_category c ON ((t.category_id = c.id)))
          WHERE (((t.transaction_type)::text = 'expense'::text) AND ((t.status)::text = 'categorized'::text))
        ), useraggregates AS (
         SELECT ue.user_id,
            COALESCE(sum(ue.amount), 0.00) AS total_spending,
            count(DISTINCT date_trunc('month'::text, (ue.transaction_date)::timestamp with time zone)) AS num_active_months
           FROM userexpenses ue
          GROUP BY ue.user_id
        ), categoryranking AS (
         SELECT userexpenses.user_id,
            userexpenses.category_id,
            min((userexpenses.category_name)::text) AS category_name,
            sum(userexpenses.amount) AS category_total,
            row_number() OVER (PARTITION BY userexpenses.user_id ORDER BY (sum(userexpenses.amount)) DESC) AS rn
           FROM userexpenses
          GROUP BY userexpenses.user_id, userexpenses.category_id
        )
 SELECT ua.user_id,
    ua.total_spending,
        CASE
            WHEN (ua.num_active_months > 0) THEN round((ua.total_spending / (ua.num_active_months)::numeric), 2)
            ELSE 0.00
        END AS monthly_average_spending,
    cr.category_id AS top_category_id,
    cr.category_name AS top_category_name,
    cr.category_total AS top_category_spending,
        CASE
            WHEN (ua.total_spending > (0)::numeric) THEN round(((cr.category_total / ua.total_spending) * (100)::numeric), 2)
            ELSE 0.00
        END AS top_category_percentage
   FROM (useraggregates ua
     LEFT JOIN categoryranking cr ON (((ua.user_id = cr.user_id) AND (cr.rn = 1))));


ALTER TABLE public.user_financial_summary OWNER TO expenses;

